		public formMain()
		{
			InitializeComponent();
			navigator = new Navigator(this);
			Init();
			ReminderRequest += formMain_ReminderRequest;
			AxolonLicense.LicenseManager.LicenseError += LicenseManager_LicenseError;
			alertControlTasks.AlertClick += alertControlTasks_AlertClick;
			ErrorHelper.ConnectionLost += ErrorHelper_ConnectionLost;
			dashboardManager.Name = "DMGRHome";
			dashboardManager.LayoutControl = dashLayoutHome;
			dashboardList.Add(dashboardManager);
			tabPageHome.Tag = dashboardManager;
			mTools.DropDownOpening += MTools_DropDownOpening;
			InitNavBar();
			navBarControl.Visible = false;
		}

		private void MTools_DropDownOpening(object sender, EventArgs e)
		{
			if (Ribbon.Minimized)
			{
				expandToolbarToolStripMenuItem.Text = "Show Toolbar";
			}
			else
			{
				expandToolbarToolStripMenuItem.Text = "Hide Toolbar";
			}
		}

		private void alertControlTasks_AlertClick(object sender, AlertClickEventArgs e)
		{
			FormActivator.BringFormToFront(FormActivator.PerformApprovalFormObj);
		}

		private void InitNavBar()
		{
			foreach (NavBarGroup group in navBarControl.Groups)
			{
				group.Visible = false;
			}
		}

		private void ErrorHelper_ConnectionLost(object sender, EventArgs e)
		{
			Application.Exit();
			Process.Start("Axolon.exe");
		}

		private void LicenseManager_LicenseError(object sender, EventArgs e)
		{
			_ = (LicenseManagerControl.LicenseErrors)sender;
		}

		private void formMain_ReminderRequest(object sender, EventArgs e)
		{
			FormActivator.BringFormToFront(FormActivator.ReminderListFormObj);
		}

