		private void tabControlDashboards_SelectedPageChanged(object sender, TabPageChangedEventArgs e)
		{
			if (isClosing)
			{
				return;
			}
			FlatDashboard flatDashboard = e.Page.Tag as FlatDashboard;
			if (barCheckItemEditDash.Checked)
			{
				FlatDashboard flatDashboard2 = e.PrevPage.Tag as FlatDashboard;
				if (flatDashboard2 != null)
				{
					flatDashboard2.SaveLayout();
					flatDashboard2.SetEditMode(isEdit: false);
					barCheckItemEditDash.Checked = false;
				}
			}
			if (flatDashboard != null && !flatDashboard.IsLoaded)
			{
				flatDashboard.LoadDashboard();
			}
		}

