		private void FormActivator_ScreenShow(object sender, EventArgs e)
		{
			if (menuWindows.Manager == null)
			{
				return;
			}
			for (int i = 0; i < menuWindows.Manager.Items.Count; i = checked(i + 1))
			{
				if (menuWindows.Manager.Items[i].Caption == ((Form)sender).Text)
				{
					return;
				}
			}
			BarItem barItem = new BarButtonItem();
			barItem.Caption = ((Form)sender).Text;
			barItem.Tag = ((Form)sender).Name;
			barItem.ItemClick += item_ItemClick;
			menuWindows.AddItem(barItem);
		}

		private void item_ItemClick(object sender, ItemClickEventArgs e)
		{
			FormActivator.BringFormToFront(e.Item.Tag.ToString());
		}

		private void FormActivator_ScreenClose(object sender, EventArgs e)
		{
			for (int i = 0; i < menuWindows.Manager.Items.Count; i = checked(i + 1))
			{
				if (menuWindows.Manager.Items[i].Caption == ((Form)sender).Text)
				{
					menuWindows.Manager.Items.RemoveAt(i);
				}
			}
		}

		private void formMain_Load(object sender, EventArgs e)
		{
			try
			{
				mainMenu.Items.Remove(testToolStripMenuTest);
				mainMenu.Items.Remove(testToolStripMenuTest);
				Font = new Font("Tahoma", 8.25f);
				RegistryHelper registryHelper = new RegistryHelper();
				string stringValue = registryHelper.GetStringValue(registryHelper.CurrentWindowsUserKey, "Skin", "");
				if (stringValue != "")
				{
					SetSking(stringValue);
				}
				else
				{
					SetSking("iMaginary");
				}
				loaded = false;
				SplashScreenManager.ActivateParentOnSplashFormClosing = false;
				Thread.Sleep(500);
				SplashScreenManager.CloseForm();
				Application.DoEvents();
				loaded = true;
			}
			catch (Exception e2)
			{
				ErrorHelper.ProcessError(e2);
			}
		}

