		private bool HasUniqueScreenID(ArrayList list, int screenID, ArrayList sameIDForms)
		{
			bool result = true;
			foreach (MethodInfo item in list)
			{
				if (int.Parse(item.Invoke(null, null).ToString()) == screenID)
				{
					sameIDForms.Add(item);
					result = false;
				}
			}
			return result;
		}

