		private void ChangeLanguage(string languageName)
		{
			try
			{
				Translator.Translators.IsTranslatorActive = true;
				IBaseForm baseForm = null;
				if (languageName != "")
				{
					Translator.Translators.ChangeLanguage(languageName);
					if (base.ActiveMdiChild != null && FormActivator.HomeFormObj.GetType() != base.ActiveMdiChild.GetType())
					{
						baseForm = (base.ActiveMdiChild as IBaseForm);
						if (baseForm != null)
						{
							baseForm.Translate();
							base.ActiveMdiChild.Refresh();
						}
					}
					Translate();
					Form[] mdiChildren = base.MdiChildren;
					foreach (Form form in mdiChildren)
					{
						if ((form != null && base.ActiveMdiChild == null) || (form != null && form.GetType() != base.ActiveMdiChild.GetType()))
						{
							baseForm = (form as IBaseForm);
							if (baseForm != null)
							{
								baseForm.Translate();
								form.Refresh();
							}
						}
					}
				}
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

