					try
					{
						UIRefelector.GetScreenID(base.ActiveMdiChild);
						(form as IDataForm)?.OnActivated();
					}
					catch (SqlException ex)
					{
						ErrorHelper.ProcessError(ex);
					}
					catch (Exception e)
					{
						ErrorHelper.ProcessError(e);
					}
				}
			}
		}

