		private void AlertPendingTasks()
		{
			try
			{
				int userPendingTasksCount = Factory.ApprovalSystem.GetUserPendingTasksCount();
				if (userPendingTasksCount > 0)
				{
					alertControlTasks.Show(this, "Pending Tasks", "You have " + userPendingTasksCount + " pending tasks that need your attention.", imageList24x24.Images[0]);
				}
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

		private void SetMenuSecurity()
		{
			foreach (ToolStripItem item in ((formMain)FormActivator.MainForm).MainMenu.Items)
			{
				if (item.Tag == null || !(item.Tag.ToString() == "1"))
				{
					MenuAccessRight menuAccessRight = Security.GetMenuAccessRight(item.Name);
					item.Visible = menuAccessRight.Visible;
					item.Enabled = menuAccessRight.Enable;
					foreach (ToolStripItem dropDownItem in (item as ToolStripDropDownItem).DropDownItems)
					{
						if (dropDownItem.Name == "menuItemAxolonMaintenance")
						{
							if (Global.CurrentUser.ToString() == "axolonfixer")
							{
								dropDownItem.Visible = true;
							}
						}
						else if (dropDownItem.Name == "containerTrackingToolStripMenuItem")
						{
							if (Global.CurrentUser.ToString() == "axolonfixer")
							{
								dropDownItem.Visible = true;
							}
						}
						else if (dropDownItem.Name == "containerTrackingWizardToolStripMenuItem")
						{
							if (Global.CurrentUser.ToString() == "axolonfixer")
							{
								dropDownItem.Visible = true;
							}
						}
						else
						{
							menuAccessRight = Security.GetMenuAccessRight(dropDownItem.Name);
							dropDownItem.Visible = menuAccessRight.Visible;
							dropDownItem.Enabled = menuAccessRight.Enable;
							ToolStripDropDownItem toolStripDropDownItem = dropDownItem as ToolStripDropDownItem;
							if (toolStripDropDownItem != null && toolStripDropDownItem.GetType() == typeof(ToolStripMenuItem))
							{
								foreach (ToolStripItem dropDownItem2 in toolStripDropDownItem.DropDownItems)
								{
									menuAccessRight = Security.GetMenuAccessRight(dropDownItem2.Name);
									dropDownItem2.Visible = menuAccessRight.Visible;
									dropDownItem2.Enabled = menuAccessRight.Enable;
								}
							}
						}
					}
				}
			}
			if (Global.CurrentUser.ToLower() != "axolonfixer")
			{
				menuItemAxolonMaintenance.Visible = false;
			}
			else
			{
				menuItemAxolonMaintenance.Visible = true;
			}
			if (Global.CurrentUser.ToLower() != "axolonfixer")
			{
				containerTrackingToolStripMenuItem.Visible = false;
			}
			else
			{
				containerTrackingToolStripMenuItem.Visible = true;
			}
			if (Global.CurrentUser.ToLower() != "axolonfixer")
			{
				containerTrackingWizardToolStripMenuItem.Visible = false;
			}
			else
			{
				containerTrackingWizardToolStripMenuItem.Visible = true;
			}
			mainMenu.Visible = true;
		}

