		public bool CanCloseChildren(bool forceClose)
		{
			bool result = true;
			checked
			{
				try
				{
					for (int i = 0; i < Application.OpenForms.Count; i++)
					{
						Form form = Application.OpenForms[i];
						if (!(form.Name == "formMain") && !(form.Name == "formHome"))
						{
							form.BringToFront();
							form.Close();
							if (forceClose)
							{
								form.Dispose();
							}
							if (!form.IsDisposed)
							{
								return false;
							}
							i--;
						}
					}
					for (int j = 0; j < Application.OpenForms.Count; j++)
					{
						Form form2 = Application.OpenForms[j];
						if (!(form2.Name != "formHome"))
						{
							form2.Close();
							if (!form2.IsDisposed)
							{
								return false;
							}
						}
					}
					return result;
				}
				catch (Exception e)
				{
					ErrorHelper.ProcessError(e);
					return result;
				}
			}
		}

		private bool CloseCompany(bool isExiting, bool forceClose)
		{
			try
			{
				isClosing = true;
				PublicFunctions.StartWaiting(this);
				if (!CanCloseChildren(forceClose))
				{
					return false;
				}
				dashboardManager.Clear();
				ClearCustomDashboards();
				UILib.LogoutCurrentCompany();
				Reset(isClosing: true);
				Factory.DisconnectDB();
				statusCurrentUser.Caption = "";
			}
			catch
			{
				return true;
			}
			finally
			{
				PublicFunctions.EndWaiting(this);
				isClosing = false;
			}
			return true;
		}

