		private void SetSking(string skinName)
		{
			try
			{
				barAndDockingController.LookAndFeel.SkinName = skinName;
				mainMenu.ForeColor = Color.Black;
				SetMenuSizing(skinName);
				RegistryHelper registryHelper = new RegistryHelper();
				registryHelper.SetValue(registryHelper.CurrentWindowsUserKey, "Skin", skinName);
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

		private void SetMenuSizing(string skinName)
		{
			if (imageListMenuBar == null || imageListMenuBar.Images.Count < 5)
			{
				return;
			}
			mainMenu.Left = 47;
			checked
			{
				mainMenu.Width = ribbonControlBars.Width - mainMenu.Left - 40;
				int num = 0;
				if (Environment.OSVersion.Version.Major == 6)
				{
					num = 6;
				}
				if (skinName == "iMaginary")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[0];
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 32 + num;
					}
					else
					{
						mainMenu.Top = 31;
					}
				}
				else if (skinName == "Caramel")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[1];
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 32 + num;
					}
					else
					{
						mainMenu.Top = 30;
					}
				}
				else if (skinName == "Money Twins")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[2];
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 34 + num;
					}
					else
					{
						mainMenu.Top = 32;
					}
				}
				else if (skinName == "Lilian")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[3];
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 34 + num;
					}
					else
					{
						mainMenu.Top = 32;
					}
				}
				else if (skinName == "Black")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[4];
					mainMenu.ForeColor = Color.White;
					mainMenu.BackColor = Color.Black;
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 32 + num;
					}
					else
					{
						mainMenu.Top = 31;
					}
				}
				else if (skinName == "Blue")
				{
					mainMenu.BackgroundImage = imageListMenuBar.Images[5];
					if (base.WindowState == FormWindowState.Maximized)
					{
						mainMenu.Top = 33 + num;
					}
					else
					{
						mainMenu.Top = 31;
					}
				}
			}
		}

