		private void LoadMenuSubstitutes()
		{
			DataSet formMenuSubstitutes = Factory.CompanyInformationSystem.GetFormMenuSubstitutes();
			List<string> list = (from x in formMenuSubstitutes.Tables[0].AsEnumerable()
				select x["MenuText"].ToString()).ToList();
			if (list.Count > 0)
			{
				foreach (ToolStripItem item in ((formMain)FormActivator.MainForm).MainMenu.Items)
				{
					foreach (ToolStripItem dropDownItem in (item as ToolStripDropDownItem).DropDownItems)
					{
						if (list.Contains(dropDownItem.Text) && dropDownItem.Text != "" && dropDownItem.Text != string.Empty)
						{
							string filterExpression = "MenuText ='" + dropDownItem.Text + "'";
							DataRow[] array = formMenuSubstitutes.Tables[0].Select(filterExpression);
							dropDownItem.Text = array[0]["AliasName"].ToString();
						}
						ToolStripDropDownItem toolStripDropDownItem = dropDownItem as ToolStripDropDownItem;
						if (toolStripDropDownItem != null && toolStripDropDownItem.GetType() == typeof(ToolStripMenuItem))
						{
							foreach (ToolStripItem dropDownItem2 in toolStripDropDownItem.DropDownItems)
							{
								if (list.Contains(dropDownItem2.Text) && dropDownItem2.Text != "" && dropDownItem2.Text != string.Empty)
								{
									string filterExpression2 = "MenuText ='" + dropDownItem2.Text + "'";
									DataRow[] array2 = formMenuSubstitutes.Tables[0].Select(filterExpression2);
									dropDownItem2.Text = array2[0]["AliasName"].ToString();
								}
							}
						}
					}
				}
			}
		}

		private void LoadCustomReports()
		{
			checked
			{
				try
				{
					for (int i = 0; i < mReport.DropDownItems.Count; i++)
					{
						ToolStripItem toolStripItem = mReport.DropDownItems[i];
						if (!(toolStripItem.GetType() == typeof(ToolStripSeparator)))
						{
							if (toolStripItem.Tag != null)
							{
								mReport.DropDownItems.Remove(toolStripItem);
								i--;
							}
							ToolStripMenuItem toolStripMenuItem = (ToolStripMenuItem)toolStripItem;
							for (int j = 0; j < toolStripMenuItem.DropDownItems.Count; j++)
							{
								toolStripItem = toolStripMenuItem.DropDownItems[j];
								if (toolStripItem.Tag != null)
								{
									toolStripMenuItem.DropDownItems.Remove(toolStripItem);
									j--;
								}
							}
						}
					}
					foreach (DataRow row in Factory.CustomReportSystem.GetCustomReportComboList().Tables[0].Rows)
					{
						ToolStripMenuItem toolStripMenuItem2 = new ToolStripMenuItem();
						string text = row["ParentMenuName"].ToString();
						if (!(text == ""))
						{
							toolStripMenuItem2.Name = row["Code"].ToString();
							toolStripMenuItem2.Text = row["Name"].ToString();
							toolStripMenuItem2.Tag = row["Code"].ToString();
							toolStripMenuItem2.Click += menuItem_Click;
							((ToolStripMenuItem)mReport.DropDownItems[text]).DropDownItems.Add(toolStripMenuItem2);
							MenuAccessRight customReportAccessRight = Security.GetCustomReportAccessRight(CustomReportTypes.CustomReport, toolStripMenuItem2.Name);
							toolStripMenuItem2.Visible = customReportAccessRight.Visible;
							toolStripMenuItem2.Enabled = customReportAccessRight.Enable;
						}
					}
				}
				catch (Exception e)
				{
					ErrorHelper.ProcessError(e);
				}
			}
		}

		private void menuItem_Click(object sender, EventArgs e)
		{
			ToolStripMenuItem toolStripMenuItem = sender as ToolStripMenuItem;
			if (toolStripMenuItem != null && toolStripMenuItem.Tag != null && !(toolStripMenuItem.Tag.ToString() == ""))
			{
				FormActivator.BringFormToFront(FormActivator.GetCustomReportForm(toolStripMenuItem.Tag.ToString()));
			}
		}

		private void LoadShortcuts()
		{
			try
			{
				ribbonGalleryFormShortcuts.Gallery.Groups[0].Items.Clear();
				foreach (DataRow row in Factory.ShortcutSystem.GetShortcuts(1, Global.CurrentUser).Tables[0].Rows)
				{
					GalleryItem galleryItem = new GalleryItem();
					galleryItem.Tag = row["ShortcutKey"].ToString();
					galleryItem.Caption = row["ShortcutText"].ToString();
					galleryItem.Hint = row["ShortcutText"].ToString();
					galleryItem.Image = imageCollection1.Images[0];
					ribbonGalleryFormShortcuts.Gallery.Groups[0].Items.Add(galleryItem);
				}
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

		private void barButtonItemAddShortcut_ItemClick(object sender, ItemClickEventArgs e)
		{
			try
			{
				SelectShortcutFormDialog selectShortcutFormDialog = new SelectShortcutFormDialog();
				selectShortcutFormDialog.ShowDialog();
				string text = "";
				string text2 = "";
				if (selectShortcutFormDialog.SelectedKey != null && !(selectShortcutFormDialog.SelectedKey == ""))
				{
					text = selectShortcutFormDialog.SelectedKey;
					text2 = selectShortcutFormDialog.SelectedText;
					ShortcutData shortcutData = new ShortcutData();
					DataRow dataRow = shortcutData.Tables[0].NewRow();
					dataRow["ShortcutType"] = 1;
					dataRow["ShortcutKey"] = text;
					dataRow["ShortcutText"] = text2;
					dataRow["UserID"] = Global.CurrentUser;
					shortcutData.Tables[0].Rows.Add(dataRow);
					if (Factory.ShortcutSystem.CreateShortcut(shortcutData))
					{
						GalleryItem galleryItem = new GalleryItem();
						galleryItem.Tag = text;
						galleryItem.Caption = text2;
						galleryItem.Hint = text2;
						galleryItem.Image = imageCollection1.Images[0];
						ribbonGalleryFormShortcuts.Gallery.Groups[0].Items.Add(galleryItem);
					}
					else
					{
						ErrorHelper.ErrorMessage("Unable to add the shortcut.", "Please try again.");
					}
				}
			}
			catch (SqlException ex)
			{
				if (ex.Number == 2627)
				{
					ErrorHelper.WarningMessage("This shortcut is already exists.");
				}
				else
				{
					ErrorHelper.ProcessError(ex);
				}
			}
			catch (Exception e2)
			{
				ErrorHelper.ProcessError(e2);
			}
		}

