		private void form_ItemDeleted(object sender, EventArgs e)
		{
			int num = 0;
			while (true)
			{
				if (num < ribbonGalleryFormShortcuts.Gallery.Groups[0].Items.Count)
				{
					if (ribbonGalleryFormShortcuts.Gallery.Groups[0].Items[num].Tag.ToString() == sender.ToString())
					{
						break;
					}
					num = checked(num + 1);
					continue;
				}
				return;
			}
			ribbonGalleryFormShortcuts.Gallery.Groups[0].Items.RemoveAt(num);
		}

