		private void customizeDashboardsToolStripMenuItem_Click(object sender, EventArgs e)
		{
			CustomizeDashboardsForm customizeDashboardsForm = new CustomizeDashboardsForm();
			if (customizeDashboardsForm.ShowDialog(this) == DialogResult.OK && customizeDashboardsForm.IsDirty)
			{
				ClearCustomDashboards();
				tabControlDashboards.SelectedTabPage = tabPageHome;
				LoadDashboardTabs();
			}
		}

		private void ClearCustomDashboards()
		{
			checked
			{
				for (int i = 0; i < tabControlDashboards.TabPages.Count; i++)
				{
					if (!(tabControlDashboards.TabPages[i].Name == "tabPageHome") && (!(tabControlDashboards.TabPages[i].Name == "tabPageParts") || !CompanyPreferences.ActivatePartsDetails))
					{
						tabControlDashboards.TabPages.RemoveAt(i);
						i--;
					}
				}
			}
		}

		private void LoadDashboardTabs()
		{
			ClearCustomDashboards();
			DataSet dashboardsByUser = Factory.DashboardSystem.GetDashboardsByUser(Global.CurrentUser);
			if (dashboardsByUser != null)
			{
				foreach (DataRow row in dashboardsByUser.Tables[0].Rows)
				{
					string text = row["DashboardID"].ToString();
					if (!(text == "dashLayoutHome"))
					{
						XtraTabPage xtraTabPage = tabControlDashboards.TabPages.Add();
						xtraTabPage.Name = text;
						xtraTabPage.Text = row["Name"].ToString();
						LayoutControl layoutControl = new LayoutControl
						{
							Name = text
						};
						xtraTabPage.Controls.Add(layoutControl);
						layoutControl.Dock = DockStyle.Fill;
						layoutControl.Visible = true;
						FlatDashboard flatDashboard = new FlatDashboard();
						flatDashboard.LayoutControl = layoutControl;
						flatDashboard.Name = "DMGR" + text;
						flatDashboard.GadgetListDoubleClick += dash_GadgetListDoubleClick;
						dashboardList.Add(flatDashboard);
						xtraTabPage.Tag = flatDashboard;
					}
				}
			}
		}

		private void dash_GadgetListDoubleClick(SmartListDrillDownActions action, DataComboType cardType, string sysDocID, string docNumber, bool isPreview)
		{
			try
			{
				FormHelper formHelper = new FormHelper();
				switch (action)
				{
				case SmartListDrillDownActions.OpenCard:
					formHelper.OpenCardForEdit(cardType, docNumber);
					break;
				case SmartListDrillDownActions.OpenTransaction:
					if (!isPreview)
					{
						formHelper.EditTransaction(sysDocID, docNumber);
					}
					else
					{
						DocumentViewForm documentViewForm = new DocumentViewForm();
						documentViewForm.Document = formHelper.GetTransactionPreviewDoc(sysDocID, docNumber);
						documentViewForm.ShowDialog();
					}
					break;
				}
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

