		private void LoadFavoriteSmartList()
		{
			try
			{
				barItemMySmartList.ClearLinks();
				foreach (DataRow row in Factory.UserFavoriteSystem.GetUserFavoriteList(Global.CurrentUser, FavoriteTypes.SmartList).Tables[0].Rows)
				{
					string tag = row["DocumentID"].ToString();
					string caption = row["FavoriteName"].ToString();
					BarItem barItem = new BarButtonItem();
					barItem.Caption = caption;
					barItem.Tag = tag;
					barItem.ItemClick += smartListFavorite_ItemClick;
					barItemMySmartList.AddItem(barItem);
				}
			}
			catch (Exception e)
			{
				ErrorHelper.ProcessError(e);
			}
		}

